import { useEffect, useState, useRef } from 'react';

function CarClient({vehiculos}) {

    const [portadaHTML, setPortadaHTML] = useState("");
    const [urlImg, setUrlImg] = useState("");

    setPortadaHTML(vehiculos.portada ? "active" : "");

    setUrlImg("img/"+vehiculos.img);

    const componentCar = vehiculos.map(
        
        element => 

        <div class="carousel-item {portadaHTML}">
                      <div class="card bg-dark text-white">
                        <img src="{urlImg}" class="card-img" alt="..."/>
                        <div class="card-img-overlay">
                          <h5 class="card-title">{element.marca}+{element.modelo}</h5>
                          <p class="card-text">{element.precio}</p>
                          <p class="card-text">{element.km}</p>
                        </div>
                      </div>
                    </div>
    )


    return (
        <p>
            {componentCar}
            {componentCar2}
        </p>
        
    );
}

export default CarClient;
